import './Reset.css';
import Header from "./components/Header/Header";
import Footer from "./components/Footer/Footer";
import Main from "./components/Main/Main";
import { BrowserRouter } from "react-router-dom";

const App = () => {
	return (
		<BrowserRouter>
			<div className='app-wrapper'>
				<Header/>
				<Main/>
				<Footer/>
			</div>
		</BrowserRouter>
	)
}


export default App;
